descricao:
Máquina de Barbear e Cortar Cabelo Recarregável Sem Fio Dragão T-Blade
Marca: XLS

Esta Máquina além de possuir um designer único, traz em sua lâmina um formato T, que facilita na hora de fazer marcações e acabamentos, contando também com uma visão limpa das lâminas permitindo mais precisão e agilidade.

Perfeita para o seu dia a dia e para Profissionais de Barbearia trazendo mais produtividade e estilo.

Fácil de limpar, resistente a água e com um motor potente chegando a 7.000 rotações por minuto.

Pode ser usada para:
–Aparar a barba;
–Cortar o cabelo;
–Fazer o pezinho e marcações;
–Acabamentos e disfarces;
–Desenhos;
–Depilar o peitoral, axilas, costas e pernas.

Especificações técnica:
-Material: Titânio + aço inoxidável;
-Pente limite: 1,5mm+2mm+3mm+4mm;
-Bateria: 1200mAh;
-Tempo de recarga: 2 horas.
-Sem fio, mais mobilidade pra você;
-5W de potência, baixo ruído, motor mais silencioso;
-Não precisa remover a bateria para carregar, basta plugar o cabo;
-Bateria de 1200mAh com duração de 120min ininterruptos;
-Compacta, leve e ergonômica;
-Portátil, Leve em suas viagens;
-Acabamento retrô em alto relevo;
-Troca rápida de pentes;
-Carregue em qualquer entrada USB (Power Bank, computadores e etc.);
-Bivolt 110/220v

Itens inclusos:
-4x Pentes (1,5mm+2mm+3mm+4mm);
-1x Escovinha de limpar
-1x Óleo da lamina
-1x Cabo de carregamento

